import styled from "../assets/styles";
import { theme } from '../assets/styles/mainStyles';

export const Button = styled.button`
    width: 195px;
    height: 44px;
    cursor: pointer;
    background: #FFFFFF;
    border-radius: 5px;
    font-style: normal;
    font-weight: bolder;
    font-size: 18px;
    color: ${theme.colors.primary};
`;

export const SendButton = styled.a`
    position: absolute;
    width: 79px;
    height: 28px;
    background: ${theme.colors.primary};
    border-radius: 5px;

    position: absolute;
    cursor: pointer;

    font-family: Montserrat;
    font-style: normal;
    font-weight: 800;
    font-size: 14px;
    line-height: 17px;
    text-align: center;

    color: #FFFFFF;
`;
